INSERT INTO `faqs` (`id`, `page_name`, `question`, `answer`, `status`, `user_id`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1,	'properties',	'Who can buy property in Dubai?',	'Any foreigner or tourist can buy properties in Dubai, but they are subject to certain restrictions. All foreign investors and expatriate residents in Dubai can buy Plots in areas designated as freehold, such as Downtown Dubai, Business Bay, Dubai Marina, and Arabian Ranches, to name a few. Similarly, they can only purchase property with leasehold rights for up to 99 years. Properties cannot be bought on behalf of a company or corporation; they most be bought in the investor\'s name directly.',	'active',	1,	'2023-06-17 03:00:39',	'2023-06-17 03:00:39',	NULL),
(2,	'properties',	'What is the average ROI for properties in Dubai?',	'5%',	'active',	1,	'2023-06-17 03:01:06',	'2023-06-17 03:01:06',	NULL),
