(5,	'resale',	'Who can buy property in Dubai?',	'Any foreigner or tourist can buy properties in Dubai, but they are subject to certain restrictions. All foreign investors and expatriate residents in Dubai can buy Plots in areas designated as freehold, such as Downtown Dubai, Business Bay, Dubai Marina, and Arabian Ranches, to name a few. Similarly, they can only purchase property with leasehold rights for up to 99 years. Properties cannot be bought on behalf of a company or corporation; they most be bought in the investor\'s name directly.',	'active',	1,	'2023-06-17 03:04:03',	'2023-06-17 03:04:03',	NULL),
(6,	'offPlan',	'What is the average ROI for properties in Dubai?',	'Dubai offers significant potential for property investment, with varying average ROI depending on factors like location, property type, and market conditions. To get accurate and up-to-date information on Dubai\'s average ROI, consult our real estate specialist or conduct comprehensive market research.',	'active',	1,	'2023-06-17 03:06:19',	'2023-06-17 03:06:19',	NULL),
(7,	'offPlan',	'What is the best neighborhood to buy Villas in Dubai?',	'Dubai offers several desirable neighborhoods for buying villas, each with its unique features and advantages. The best neighborhood to buy villas depends on individual preferences, such as lifestyle, amenities, proximity to schools and businesses, and investment potential. Some popular villa neighborhoods in Dubai include Palm Jebel Ali, Dubai Creek Harbour, Emirates Hills, Palm Jumeirah, Jumeirah Golf Estates, and Dubai Hills Estate.',	'active',	1,	'2023-06-17 03:06:49',	'2023-06-17 03:06:49',	NULL),
(8,	'offPlan',	'What do you need to know about buying Apartments in Dubai?',	'When buying apartments in Dubai, it\'s important to consider factors such as ownership type (freehold or leasehold), developer reputation, location, and property features. Research the developer\'s track record, choose a convenient location with essential amenities, and evaluate the apartment\'s layout and facilities to make an informed decision.',	'active',	1,	'2023-06-17 03:07:13',	'2023-06-17 03:07:13',	NULL),
(9,	'offPlan',	'How long does it take from registering the sale of a property to receiving the title deed?',	'The timeline for receiving the title deed after registering the sale of a property in Dubai can vary. On average, it takes around 30 to 45 days for the title deed to be issued. However, the exact duration can be influenced by factors such as the efficiency of The Land Department, any outstanding documentation or legal requirements, and the complexity of the transaction.',	'active',	1,	'2023-06-17 03:07:47',	'2023-06-17 03:07:47',	NULL),
(10,	'faqs',	'How long does it take from registering the sale of a property to receiving the title deed?',	'The timeline for receiving the title deed after registering the sale of a property in Dubai can vary. On average, it takes around 30 to 45 days for the title deed to be issued. However, the exact duration can be influenced by factors such as the efficiency of The Land Department, any outstanding documentation or legal requirements, and the complexity of the transaction.',	'active',	1,	'2023-06-17 03:28:49',	'2023-06-17 03:28:49',	NULL),
