INSERT INTO `rich_texts` (`id`, `record_type`, `record_id`, `field`, `body`, `created_at`, `updated_at`) VALUES
(1,	'App\\Models\\Service',	1,	'description',	'<div class=\"trix-content\">\r\n    <div class=\"trix-content\">\r\n    <div class=\"trix-content\"><div class=\"trix-content\" style=\"\"><b>In the last period, the UAE became one of the most visited and lived-in countries worldwide. People come here for many reasons like investing, launching a new business, gathering with their families, or finding a high-quatity lifestyle.</b></div><div class=\"trix-content\" style=\"\"><br></div><div class=\"trix-content\" style=\"\">In the last period, the UAE became one of the most visited and lived-in countries worldwide. People come here for many reasons like investing, launching a new business, gathering with their families, or finding a high-quatity lifestyle. For all these reasons and more, buying a home in the UAE is a good decision on all levels. The UAE includes different emirates at which you will enjoy an ideal residential experience; however, Oubai, Abu Dhabi, and Sharjah are the most chosen and recommended cities where you will find a variety of options to suit your preferences. If you\'re willing to get a new house in the UAE, then the first thing to decide is which emirate suits your needs, plan, and budget.</div><div class=\"trix-content\" style=\"\"><br></div><div class=\"trix-content\" style=\"\">In addition, if you choose to live in Dubai and are thinking of investing your money in real estate, you\'re on the right track. There are many properties for sale in the UAE so you\'re not limited to a few choices in such a big step. On the other hand, in case you want to buy a property in the UAE in a more Quiet and family-friendly atmosphere, then Abu Dhabi suits you the most.</div><div class=\"trix-content\" style=\"\"><br></div><div class=\"trix-content\" style=\"\">It\'s not just the capital of the country but also among the high-in-demand living areas for expats and citizens. Abu Dhabi offers you all the services and facilities you might need whether you\'re living on your own or with your family. It features numerous reputable communities where you can easily get a nice permanent home. In addition, if you have a business in the capital, then the optimum solution is owning a home in the same city too.</div><div class=\"trix-content\" style=\"\"><br></div><div class=\"trix-content\" style=\"\">Furthermore, Sharjah is a good city for those who want to buy a unit yet with affordable prices and also seek a budget•friendly lifestyle. Its residents relish many perks; firstly it has a prime location neighboring Dubai which allows you to easily commute between them. So if you\'re looking for an apartment or villa for sale in Sharjah, you\'d be making a wise choice. Secondly, Sharjah is a hub for universities so if you have kids who are about to join college, Sharjah offers them various reputable options. Finally, the emirate features different leisure options so you can disconnect from the routine whenever you want.</div><div class=\"trix-content\">\r\n</div>\r\n</div>\r\n</div>\r\n</div>',	'2023-06-02 09:48:41',	'2023-06-07 09:25:34'),
(2,	'App\\Models\\Agent',	1,	'message',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <p><span style=\'color: rgba(0, 0, 0, 0.9); font-family: -apple-system, system-ui, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", \"Fira Sans\", Ubuntu, Oxygen, \"Oxygen Sans\", Cantarell, \"Droid Sans\", \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\", \"Lucida Grande\", Helvetica, Arial, sans-serif; font-size: 14px;\'>Self-discipline, determination, honesty and dedication to the task are some qualities that belong to his nature. Professionalism, a special demeanor and direct conversations are his special characteristics. His youth and his life story have made him what he is today. Clear statements and comprehensibility for details as well as costs to solve the task efficiently and to deliver above average, he has successfully proven with his own projects for decades. His professionalism is versatile, since he acquires everything for all areas.</span><br></p>&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-05 02:26:51',	'2023-06-19 07:09:51'),
(3,	'App\\Models\\Article',	1,	'content',	'<div class=\"trix-content\">\r\n    <div class=\"trix-content\">\r\n    <p>Established in 2008, we have helped thousands of people from all over the world find their dream home and benefit from the best real estate investments available on the market to generate excellent rental yields and year-on-year capital appreciation</p><p><span style=\"font-size: 1rem;\">We otter a wade range Of professional services to suit buyers, sellers, landlords and tenants alike Whether you\'re Looking to buy, sell or rent a property, we Offer honest impartial advice, market leading expertise, sound geographical knowledge and the Latest facts and figures to ensure you can make an Informed decision before you invest</span><br></p><p><span style=\"font-size: 1rem;\">Established in 2008, we have helped thousands of people from all over the world find their dream home and benefit from the best real estate investments available on the market to generate excellent rental yields and year-on-year capital appreciation</span><br></p><p><span style=\"font-size: 1rem;\">We otter a wade range Of professional services to suit buyers, sellers, landlords and tenants alike Whether you\'re Looking to buy, sell or rent a property, we Offer honest impartial advice, market leading expertise, sound geographical knowledge and the Latest facts and figures to ensure you can make an Informed decision before you invest</span><br></p><p><span style=\"font-size: 1rem;\">Established in 2008, we have helped thousands of people from all over the world find their dream home and benefit from the best real estate investments available on the market to generate excellent rental yields and year-on-year capital appreciation</span><br></p><p><span style=\"font-size: 1rem;\">We otter a wade range Of professional services to suit buyers, sellers, landlords and tenants alike Whether you\'re Looking to buy, sell or rent a property, we Offer honest impartial advice, market leading expertise, sound geographical knowledge and the Latest facts and figures to ensure you can make an Informed decision before you invest</span><br></p>\r\n</div>\r\n</div>',	'2023-06-05 03:38:51',	'2023-06-05 03:49:13'),
(4,	'App\\Models\\Article',	2,	'content',	'<p>Dubai is one of the top five most visited cities in the world as the short-term rental market flourishes, especially as FIFA World Cup Qatar 2022 nears.</p><p><span style=\"font-size: 1rem;\">According to Dubai-based real estate agency Unique Properties, there has been a “strong demand” for short-term rentals in the UAE.</span><br></p><p><span style=\"font-size: 1rem;\">However, unlike the global boom for short-term rentals that has existed for a long time, the UAE only grew as a preferred city for the same in 2016, after it was made legal.</span><br></p><p><span style=\"font-size: 1rem;\">“The growth of Dubai’s short-term rental market is far from over. Dubai still trails major markets like London which has double the number of vacant rental listings but the uptick in remote and work-from-home models, along with the fact that Dubai is one of the top five most visited cities in the world, will continue to see the city’s short-term rental market flourish,” Unique Properties’ founder and chief executive officer Arash Jalili said.</span><br></p><p><span style=\"font-size: 1rem;\">Expo 2020 Dubai, which ran from October 1, 2021 to March 31, 2022, was a “key contributor” to the short-term rental market in the emirate, as international visitors were given the option to skip long-term tenancy contracts, thus retaining their “freedom of mobility, and save costs during the exhibition,” the company said in an emailed statement.</span><br></p><p><span style=\"font-size: 1rem;\">Post the mega-event which ended this year, Dubai currently has 10,000 active vacation rental listings.</span><br></p><p><span style=\"font-size: 1rem;\">“There are 10,000 active rental listings in Dubai and their occupancy rates rose by 32 percent from December 2020 to December 2021; average daily rates have grown between 15 to 28 percent and monthly rates are rising to 94 percent.”</span><br></p><p><span style=\"font-size: 1rem;\">Moreover, with the UAE easing mask rules, visitors are looking up to Dubai to stay or visit, especially ahead of the FIFA World Cup 2022 Qatar.</span><br></p><p><span style=\"font-size: 1rem;\">“More travelers are poised to visit Dubai in the coming months and contribute to the growth of the city’s short-term rental market,” Unique Properties said adding that the World Cup has placed the emirate as “a preferred destination to situate themselves before, during, and even after the event,” globally.</span><br></p><p><span style=\"font-size: 1rem;\">“The emirates’ proximity and easy access to Qatar, coupled with the fact that rents have risen 30 percent in Qatar compared to a year ago, will see Dubai benefit considerably,” the real estate company said.</span><br></p>',	'2023-06-05 03:51:15',	'2023-06-05 03:51:15'),
(5,	'App\\Models\\Agent',	2,	'message',	'<div class=\"trix-content\">\r\n    <div class=\"trix-content\">\r\n    <p>I<span style=\'color: rgb(0, 0, 0); font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\'>t is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span></p>\r\n</div>\r\n</div>',	'2023-06-05 07:17:57',	'2023-06-14 08:05:23'),
(6,	'App\\Models\\Agent',	3,	'message',	'<div class=\"trix-content\">\r\n    <div class=\"trix-content\">\r\n    <p><span style=\'color: rgb(0, 0, 0); font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\'>It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span><br></p>\r\n</div>\r\n</div>',	'2023-06-05 07:19:01',	'2023-06-14 08:05:32'),
(7,	'App\\Models\\Agent',	4,	'message',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;\n    <p><span style=\'color: rgb(0, 0, 0); font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\'>Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</span></p><p><span style=\'color: rgb(0, 0, 0); font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\'>The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</span><span style=\'color: rgb(0, 0, 0); font-family: \"Open Sans\", Arial, sans-serif; font-size: 14px; text-align: justify;\'><br></span><br></p>&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-05 07:20:33',	'2023-06-21 12:24:49'),
(8,	'App\\Models\\Property',	1,	'description',	'Unique Properties are pleased to offer you this 2 Bedroom Apartment for sale in Burj Royale,  Downtown Dubai.\n\nFeatures:\n• Open Plan and unequipped kitchen\n• Floor to Ceiling windows\n• Built-in Wardrobes\n• Resort-style living\n• World-class amenities\n• Modern design\n\nUnit Details:\n• Bedrooms: 2\n• Bathrooms: 2\n• BUA: 1,038 sq.ft.\n• Parking Spaces: 1\n\nDowntown is an urban concept and upscale mixed-use community lending itself to vibrant living. Commercial, residential, hospitality, entertainment and leisure facilities rub shoulders with green spaces, water features, lakes, and fountains. Downtown sits adjacent to the Burj area, and its famous boulevard, iconic shopping mall, dancing fountains, and first-class amenities in the vicinity of the world’s tallest tower.\n\nConnectivity:\n• 9 minutes to Dubai Mall\n• 21 minutes to Palm Jumeirah\n• 20 minutes to Burj Al Arab\n• 25 minutes to The Walk JBR\n• 30 minutes to Dubai Marina\n• 32 minutes to Dubai International Airport (DXB)\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-05 10:26:42',	'2023-06-05 10:26:42'),
(9,	'App\\Models\\Property',	2,	'description',	'Unique Properties exclusively  presents this apartment for Sale: Amazing penthouse with a beautiful view, L-Shape Large Balcony. \n\nEmaar Beachfront is located in Marina overlooking the Palm where everything you wish for is just a few minutes away.\n\nFEATURES:\n\n* Developer: Emaar Properties\n* Bedrooms – 4\n* Bathrooms – 4\n* Sea &amp; Marina View\n* Parking Space - 2\n* BUA - 2728 sq.ft.\n* Equipped kitchen\n* Built-in Wardrobes\n* L Shape Balcony\n* Handover date is 1st Quarter 2022. \n\nACCESSIBILITY:\n\n* Easy access to Dubai Marina and Sheikh Zayed Road\n* 20 minutes drive to Dubai Mall\n* 20 minutes drive to Business Bay\n* 20 minutes drive to DIFC\n* 30 mintues drive to the DXB International Airport\n\nTHE COMMUNITY:\n\nWhere the sea greets you every morning, and pristine white sand welcomes you home—on an island with a statement address in Dubai. Awaken your senses with every breath, as you redefine your premium lifestyle, overlooking the majestic Arabian Sea at Emaar Beachfront.\n\n\nWhy Unique Properties?\n\n• EMAAR\'s Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020 and 2021\n• DUBAI PROPERTIES\' Top Broker of 2015, 2016, 2017, 2018, 2019, 2020 and 2021\n• DUBAI PROPERTIES\' No.1 Top Selling Agent in 2017, 2018 and 2020\n• MERAAS Top Agent of 2018, 2019, 2020 and 2021\n• NSHAMA\'s Top Agent of 2015, 2016 and 2020\n• NAKHEEL’s Top Broker for 2021\n• DAMAC\'s no. 1 Real Estate Agency in 2020\n• DUBAI SOUTH Top Performing Agent 2016\n• DANUBE PROPERTIES Premier Broker of 2015 and 2016\n• PROPERTY FINDER’s outstanding online listings award winner 2014\n\nFor all property inquiries, please contact:\nHot Line Mobile No: +971524193888\nToll Free: 800 18881\nEmail: Info@uniqueproperties.ae',	'2023-06-05 10:28:39',	'2023-06-05 10:28:39'),
(10,	'App\\Models\\Property',	3,	'description',	'Unique Properties is thrilled to offer you this 1-bedroom + study apartment for rent in The Loft Tower by Emaar, Downtown Dubai.\n\nFeatures:‎\n• Floor to ceiling windows \n• Open plan kitchen\n• Kitchen appliances \n• Built in wardrobes\n• High speed elevators \n• Community gardens \n• Squash facility\n• Children\'s playground \n• Business Centre &amp; Venue for corporate events\n\nUnit Details:\n• Bedroom:  1bedroom + Study\n‎• ‎Bathrooms: 1\n• Parking Spaces: 1\n‎‎• ‎BUA: 899 sq.ft\n\nThe Lofts is a multi-building complex and The three residential towers are on a 500-acre site. Amenities include a leisure deck with open air swimming pools, private courtyards and immaculately maintained gardens. There are 497 apartments ranging in size from studios to two-beds.\n\nConnectivity:‎\n‎•‎ ‎3 minutes’ drive to Dubai Mall\n•‎ ‎20 minutes to Palm Jumeirah\n‎•‎ ‎19 minutes to Burj Al Arab\n‎•‎ ‎24 minutes to The Walk JBR\n‎•‎ ‎‎16 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎46 minutes to Al Maktoum International Airport\n\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-07 02:16:38',	'2023-06-07 02:16:38'),
