(18,	'App\\Models\\Community',	7,	'description',	'<div class=\"trix-content\">\r\n    <div class=\"trix-content\">This expansive development set along Al Khail Road spans from Downtown to Palm Jumeirah and is home to the Dubai Hills Mall, one of the largest malls in the world. This one-of-a-kind community features over 1.4 million square metres of parks and open spaces, an 18-hole championship golf course, a commercial district, retail boulevards, cycling tracks, walking trails, schools, key sporting facilities, schools and hospitals.</div><div class=\"trix-content\"><br></div><div class=\"trix-content\">Consisting of apartments, villas and townhouses, the unique sub communities of Dubai Hills Estate include; Collective, Emerald Hills, Executive Residences, Acacia, Club Villas, Golf Suites, Golf Grove, Golf Place, Golfville, Majestic Vistas, Maple, Mulberry, Park Heights, Park Point and Park Ridge. With easy access to Dubai’s major road arteries likes of Al Khail Road and Mohammed Bin Zayed Road, Dubai Hills Estate allows residents to have a simple to commute to many of Dubai’s key locations.</div><div class=\"trix-content\">\r\n</div>\r\n</div>',	'2023-06-08 07:54:51',	'2023-06-08 07:56:35'),
