(20,	'App\\Models\\Property',	10,	'description',	'Unique Properties is thrilled to offer you this full floor 4-bedroom apartment for sale in Le Pont, La Mer, Jumeirah.\n\nFeatures:\n• Floor to ceiling windows\n• Built-in wardrobes\n• A fully fitted kitchen\n• Communal swimming pools\n• Landscaped gardens\n• Children’s play areas\n• A fully-equipped gym\n• Resort style living\n• A world class marina\n• A promenade with cafes and restaurants\n\nUnit Details:\n• Bedroom:  4\n‎• ‎Bathrooms: 6\n• Parking Spaces: 2\n‎‎• ‎BUA: 4,678 sq.ft\n\nExperience A Truly World-Class Beachfront At La Mer. Inspired by the charm of the Mediterranean, Port de La Mer provides people who live here a panoramic view of open waters and Dubai skyline, and also a new choice of life. The residences blend modern architecture and the interior design. Besides, the residences are surrounded by beaches and docks, presenting a picture of quiet and comfortable beachfront life, bringing people live here life passion and vitality.\n\nConnectivity:‎\n‎•‎ ‎19 minutes’ drive to Dubai Mall\n•‎ ‎31 minutes to Palm Jumeirah\n‎•‎ ‎29 minutes to Burj Al Arab\n‎•‎ ‎35 minutes to The Walk JBR\n‎•‎ ‎‎22 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎54 minutes to Al Maktoum International Airport\n\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-08 09:59:56',	'2023-06-08 09:59:56'),
(21,	'App\\Models\\Property',	11,	'description',	'Unique Properties Broker proudly presents this Apartment for Rent : This 2 bedroom unit features a spacious living area with built-in wardrobes in the bedroom, cabinets and drawers in the kitchen and plenty of storage spaces. The unit has an equipped kitchen and spacious living room.\n\nFEATURES:\n\n* Bedroom : 2\n* Bathroom : 2\n* Parking : 1\n* Size : 1,487.90 sqft\n* Built in Wardrobes\n\nTHE COMMUNITY:\n\nDubai Sports City is a neighbourhood that packs in a lot in terms of lifestyle and residential options, at a wallet-friendly price. Home to the International Cricket Stadium and Els Club, this upcoming development is the most sought-after destination for investors. There’s a mix of villa compounds and apartment complexes with a range of options for those considering to invest in Sports City. \n\nACCESSIBILITIES:\n\n- 15-minute drive to the Dubai Marina – one of Dubai’s top leisure hub.\n- 15 minutes from two of Dubai’s biggest business hubs\n- 25 minutes from Dubai International Airport\n- Direct access to Sheikh Zayed Road (which links the seven emirates)\n- Al Khail Road is accessible within a few minutes\n\nWhy Unique Properties?\n* EMAAR\'s Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020 and 2021\n* DUBAI PROPERTIES\' Top Broker of 2015, 2016, 2017, 2018, 2019, 2020 and 2021\n* DUBAI PROPERTIES\' No.1 Top Selling Agent in 2017, 2018 and 2020\n* MERAAS Top Agent of 2018, 2019, 2020 and 2021\n* NSHAMA\'s Top Agent of 2015, 2016 and 2020\n* DAMAC\'s no. 1 Real Estate Agency in 2020\n* EMAAR\'s No.1 Top Selling Agent in 2015\n* NAKHEEL’s Top Broker for 2021\n* DUBAI SOUTH Top Performing Agent 2016\n* DANUBE PROPERTIES Premier Broker of 2015 and 2016\n* PROPERTY FINDER’s outstanding online listings award winner 2014\n\nFor all property inquiries, please contact:\nHot Line Mobile No: +971 50 9250 888\nToll Free: 800 18881',	'2023-06-08 09:59:56',	'2023-06-08 09:59:56'),
(22,	'App\\Models\\Property',	12,	'description',	'Unique Properties are pleased to offer you this 2 Bedroom Apartment that features a modern design, world-class amenities, and resort-style living. It offers a premium lifestyle for the whole family with residential amenities including state-of-the-art gymnasiums, swimming pools, and children’s play areas.\n\nFEATURES:\n\n* BUA: 1058 sq.ft.\n* Bedrooms: 2\n* Bathrooms: 2\n* Parking spaces: 1\n* Floor to Ceiling windows\n* Built-in Wardrobes\n* Fully Fitted Kitchen\n* Balcony\n\nACCESSIBILITY:\n\n* 10 minutes to Dubai Mall\n* 21 minutes to Palm Jumeirah\n* 15 minutes to Burj Al Arab\n* 25 minutes to The Walk JBR\n* 25 minutes to Dubai Marina\n* 20 minutes to Dubai International Airport (DXB)\n\nTHE COMMUNITY:\n\nDubai Creek is Dubai\'s brand-new vision. For families and individuals seeking a luxury residence in Dubai, this community is a perfect choice. Located just 15 minutes away from Dubai Downtown, Dubai Creek Harbour is set to become the new Downtown Dubai &amp; is often called the “upgraded Downtown Dubai”. Dubai Creek Tower is also planned for the community, which will be higher than the Burj Khalifa by about 100 meters.\n\nWhy Unique Properties?\n\n• EMAAR\'s Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020 and 2021\n• DUBAI PROPERTIES\' Top Broker of 2015, 2016, 2017, 2018, 2019, 2020 and 2021\n• DUBAI PROPERTIES\' No.1 Top Selling Agent in 2017, 2018 and 2020\n• MERAAS Top Agent of 2018, 2019, 2020 and 2021\n• NSHAMA\'s Top Agent of 2015, 2016 and 2020\n• NAKHEEL’s Top Broker for 2021\n• DAMAC\'s no. 1 Real Estate Agency in 2020\n• DUBAI SOUTH Top Performing Agent 2016\n• DANUBE PROPERTIES Premier Broker of 2015 and 2016\n• PROPERTY FINDER’s outstanding online listings award winner 2014\n\nFor all property inquiries, please contact:\nHot Line Mobile No: +971524193888\nToll Free: 800 18881\nEmail: Info@uniqueproperties.ae',	'2023-06-08 09:59:56',	'2023-06-08 09:59:56'),
