(59,	'App\\Models\\Property',	49,	'description',	'Unique Properties is proud to bring to the market this Resale 1 Bedroom Apartment Located in Myrtle, Citywalk.\n\nFEATURES:\n\n* 1 Bedroom\n* 2 Bathroom\n* Resale\n* BUA: 676 sqft\n* Lush green landscapes\n* True park lifestyle\n* Pool and water play areas\n* Kids play area\n* Outdoor gym and fitness area\n* 1 minute from City walk mall\n* 15 minutes to the International airport\n\nTHE COMMUNITY:\n\nCity Walk is reminiscent of European-style street culture mixed with Dubai’s love of high-end retail and international dining options. The community is meticulously arranged to create a unique and well-defined residential and commercial development that stands apart from others in its class. Residents and visitors alike would fall in love with the striking vista of city skyscrapers, including the magnificent Burj Khalifa.\n\nWhy Unique Properties?\n\n• EMAAR\'s Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020 and 2021\n• DUBAI PROPERTIES\' Top Broker of 2015, 2016, 2017, 2018, 2019, 2020 and 2021\n• DUBAI PROPERTIES\' No.1 Top Selling Agent in 2017, 2018 and 2020\n• MERAAS Top Agent of 2018, 2019, 2020 and 2021\n• NSHAMA\'s Top Agent of 2015, 2016 and 2020\n• NAKHEEL’s Top Broker for 2021\n• DAMAC\'s no. 1 Real Estate Agency in 2020\n• DUBAI SOUTH Top Performing Agent 2016\n• DANUBE PROPERTIES Premier Broker of 2015 and 2016\n• PROPERTY FINDER’s outstanding online listings award winner 2014\n\nFor all property inquiries, please contact:\nHot Line Mobile No: +971524193888\nToll Free: 800 18881\nEmail: Info@uniqueproperties.ae',	'2023-06-08 09:59:57',	'2023-06-08 09:59:57'),
(60,	'App\\Models\\Property',	50,	'description',	'Unique Properties is thrilled to offer you this 2-bedroom apartment for rent in Tower A, Damac Towers by Paramount, Business Bay\n\nFeatures:‎\n• Downtown views\n• High Speed Elevator\n• Built in wardrobe\n• Fully Equipped kitchen with appliances and utensils\n\nUnit Details:\n• Bedroom: 2\n‎• ‎Bathrooms: 2\n‎‎• ‎BUA: 1,517 sq.ft\n• Parking: 1\n\nDamac Towers by Paramount Hotels &amp; Resorts is Hollywood-inspired four-tower development overlooking the Burj Area in Dubai.\n\nThe buildings provide luxury serviced residences with stunning views and an array of amenities including fully fitted kitchens, high-end concierge services, in-room facilities, a luxurious spa, kids club and in-room facilities. The four buildings are all connected to a multi-level plaza that offers food and beverage services, recreational rooms for parties and events, a wellness and fitness centre, expansive swimming pools and retail shops\n\nConnectivity:‎\n‎•‎ ‎11 minutes’ drive to Dubai Mall\n•‎ ‎24 minutes to Palm Jumeirah\n‎•‎ ‎23 minutes to Burj Al Arab\n‎•‎ ‎28 minutes to The Walk JBR\n‎•‎ ‎‎17 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎45 minutes to Al Maktoum International Airport\n\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Pe