(130,	'App\\Models\\Property',	120,	'description',	'Unique Properties is thrilled to offer you this 2-bedroom apartment for sale in Golf Vista, DAMAC Hills\n\nFeatures:‎\n• Full Golf Course and Park Views\n• Fully Furnished\n• Fully-fitted kitchen appliances\n• Vacant\n• Huge Balcony\n• Floor to ceiling windows\n• Built in wardrobes\n• Security\n\nUnit Details:\n• Bedroom:  2 + Maids\n‎• ‎Bathrooms: 3\n• Parking Spaces: 1\n‎‎• ‎BUA:2005 sq.ft\n\nGolf Vista, also named Golf Promenade, is a mixed-use and low-rise residential building located in Damac Hills, Dubai. Homebuyers have a choice of 1-, 2-, and 3-bedroom units in Dubai. Golf Vista is part of the mega project \"Golf Town,\" launched by DAMAC Properties to cater to a new luxury residential lifestyle in Dubai.\nDamac Hills (formerly known as Akoya) is developed by Damac Properties. A well-established, self-contained community comprising villas, apartments, and a hotel set around an 18-hole PGA championship golf course.\n\nConnectivity:‎\n‎•‎ ‎27 minutes’ drive to Dubai Mall\n•‎ ‎21 minutes to Palm Jumeirah\n‎•‎ ‎23 minutes to Burj Al Arab\n‎•‎ ‎25 minutes to The Walk JBR\n‎•‎ ‎‎32 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎29 minutes to Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FU