(174,	'App\\Models\\Property',	164,	'description',	'Unique Properties proudly presents this 1 Bedroom ‎Apartment in Sobha Hartland - Hartland Waves, MBR City.‎\n\nFeatures:‎\n‎•‎ ‎High Floor\n‎•‎ ‎Lush green spaces\n‎‎• Balcony\n‎‎• ‎Sports and wellness areas\n‎‎• Built in Wardrobes\n‎‎• Pets Allowed\n‎‎• Covered Parking\n\nUnit Details:\n‎• ‎BUA: 519 sq. ft.‎\n‎• Bedroom: 1‎\n‎• ‎Bathrooms: 1‎\n‎• Parking spaces: 1‎\n\nHartland Waves is a 36-storey residential building in Sobha Hartland,, Mohammed Bin Rashid City,,, Dubai. The project was developed by Sobha Realty through its subsidiary Sobha.\n\nHartland Waves comprises a mix of one- and two-bedroom apartments. Amenities include barbecue facilities,, covered parking, fitted wardrobes, floor-to-ceiling windows, food and beverage outlets, a gymnasium, an infinity pool, a kids\' play area, an outdoor gymnasium and yoga and meditation areas.\n\nConnectivity:‎\n‎•‎ ‎15 minutes’ drive to Dubai Mall\n•‎ ‎26 minutes to Palm Jumeirah\n‎•‎ ‎25 minutes to Burj Al Arab\n‎•‎ ‎30 minutes to The Walk JBR\n‎•‎ ‎‎17 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎41 minutes to Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-08 10:00:00',	'2023-0