(184,	'App\\Models\\Property',	174,	'description',	'Unique Properties is pleased to offer you this 1-Bedroom Apartment in The Pad, Business Bay.\n\nFeatures:\n‎•‎ Burj Khalifa view\n‎• ‎Floor to Ceiling windows\n‎•‎ Built-in Wardrobes\n‎•‎ Abundance of Natural Light\n‎•‎ State-of-the-art Gymnasium	\n‎•‎ Running Track\n‎•‎ Half Basketball Court\n‎• ‎Outdoor Sunset Terrace\n‎• ‎Meeting Lounge\n\nUnit Details:\n‎• ‎BUA: 523 sq ft\n‎•‎ Bedroom: 1‎\n‎•‎ Bathrooms: 1‎\n‎•‎ Parking: 1‎\n\nThe Pad brings South Beach to Dubai. Tilted at a 6.5 angle, enveloped in LED lighting, the chic and sophisticated Pad is the pinnacle of super-glamorous condo living, the most striking building on the Creek, presiding over the Burj Khalifa and the sea.\n\nDuring the day the unique facade shines and shimmers, reflecting the ethereal-blend of sea, sun and sky. At night, this spectacular exterior blazes from hot to cool, from vibrant disco to the dark mystery and allure of desert stars.\n\nConnectivity \n‎•‎ 8 minutes to Dubai Mall\n‎•‎‎ 20 minutes to Dubai Marina\n‎•‎‎ 18 minutes to Burj Al Arab\n‎•‎‎ 23 minutes to The Walk JBR\n‎•‎‎ 15 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎42 minutes to Al Maktoum International Airport\n\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2