(197,	'App\\Models\\Property',	187,	'description',	'Unique Properties is pleased to offer you this 1-Bedroom Apartment in Asayel, Madinat Jumeirah Livings.‎\n\nFeatures:\n‎•‎ ‎Community-facing Unit\n‎•‎ Floor to ceiling windows\n‎•‎ Spacious and luxurious bedrooms\n‎•‎ Mighty terrace and balconies\n‎•‎ Modern interiors with elegant finishing\n‎•‎ Abundance of natural light\n‎•‎ Open plan kitchen\n‎•‎ State-of-the art amenities\n‎•‎ Private beach access\n‎• A community centre\n\nUnit Details:\n‎•‎ ‎BUA: 773 sq. ft.‎\n‎•‎ Bedroom: 1‎\n‎•‎ Bathrooms: 1‎\n‎•‎ Parking: 1‎\n‎•‎ ‎Mid Floor\n\nAsayel Madinat Jumeirah is famous for its luxury living, urban lifestyle, breathtaking views, and first-class amenities. The guests can feel the unique atmosphere of this place while relishing the high level of warmth specific to Asayel Madinat Jumeirah apartments.\n\nThis opulent and vibrant community offers its residents easy access to elite facilities &amp; amenities.\n\nLocation\n‎•‎ ‎5 minutes to Mall of Emirates\n‎•‎ ‎2 minutes to Sheikh Zayed Rd\n‎•‎ ‎8 minutes to Dubai Media City\n‎•‎ 25 minutes to Dubai International Airport (DXB)‎\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-08 10:00:01',	'2023-06-23 13:54:22'),
