(212,	'App\\Models\\Property',	202,	'description',	'Unique Properties proudly presents this best location, mixed use, corner plot for sale in Bukadra MBR City.\n\nFeatures:\n‎• ‎Resale\n‎• ‎Plot Area: 73,202.9 sq ft.\n‎• ‎Capacity: B+G+4P+39\n‎• ‎Comprises of: 5% Retail spaces | 30% Offices | 65% Residential\n‎• ‎Price is negotiable for serious buyers\n\nBukadra is a small, developing locality in MBR City, Mydan. Bukadra is situated south of Dubai Creek, adjacent to Ras Al Khor Industrial Areas. The community is part of Dubai Municipality\'s expansion, south of the Creek.\nHistorically, BuKadra was not a residential area, but housed various community and sports clubs. The Dubai government has undertaken to develop BuKadra into Meydan City, a horseracing real estate project.\n\nConnectivity:\n‎• 12 minutes to drive to Dubai Mall\n‎• 24 minutes to Palm Jumeirah\n‎• 22 minutes to Burj Al Arab\n‎• 28 minutes to The Walk JBR\n‎• 25 minutes to Dubai International Airport (DXB) \n‎•  42 minutes Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.‎\n\n‎ Why Unique Properties?‎\n‎• RERA Top Performing Award 2021‎\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022‎\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021‎\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021‎\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022‎\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n‎• NAKHEEL Top Broker for 2021‎ &amp; 2022‎\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021‎\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017‎\n‎• MEYDAN Top Performing Award 2021‎\n‎• MAJID AL FUTTAIM Top Performer 2020‎\n‎• ALDAR Top Performer 2021‎',	'2023-06-08 10:00:02',	'2023-06-08 10:00:02'),
