(230,	'App\\Models\\Property',	220,	'description',	'Unique Properties is thrilled to offer you this 2-bedroom apartment for sale in Rimal 3, Jumeirah Beach Residence.\n\nFeatures:‎\n• Semi Furnished\n• Semi-open kitchen\n• Floor to ceiling windows\n• Spacious living rooms\n• Intercom services in each unit\n• Extensive lobby\n• High standard amenities\n• Barbecue area\n• Outdoor area for an event space\n\nUnit Details:\n• Bedroom:  2\n‎• ‎Bathrooms: 3\n• Parking Spaces: 1\n‎‎• ‎BUA: 1,470 sq.ft\n\nRimal 3, is surrounded by beaches and luxurious hotels, JBR is one of the most sought-after places in the world. Popular among tourists and locals, the area is home to many malls, boulevards and commercial and residential skyscrapers.\n\nIn addition to featuring amazing views, Rimal 3 is also located on an ideal spot close to the commercial area and entertainment places like The JBR, Marina beach and Marina Walk. Retail stores, supermarkets and restaurants are also located right at the doorstep.\n\nConnectivity:‎\n‎•‎ ‎20 minutes’ drive to Dubai Mall\n•‎ ‎12 minutes to Palm Jumeirah\n‎•‎ ‎17 minutes to Burj Al Arab\n‎•‎ ‎10 minutes to The Walk JBR\n‎•‎ ‎‎28 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎32 minutes to Al Maktoum International Airport\n\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 20