(235,	'App\\Models\\Property',	225,	'description',	'Unique Properties proudly presents this 1 Bedroom Apartment located in Address Harbour Point, Dubai Creek Harbour (The Lagoons)\n\nFeatures:‎\n• Creek &amp; Burj Khalifa View\n• Floor to Ceiling windows\n• Fully Fitted Kitchen\n• Built-in Wardrobes\n\nUnit Details:\n• Bedroom: 1\n‎• ‎Bathrooms: 1\n• Parking space: 1\n• BUA: 728 sq.ft\n\nDubai Creek Harbour is the future living and At Dubai Creek Harbour, you can relish the captivating views of the wildlife haven by the Ras Al Khor wildlife sanctuary and enjoy an idyllic life in harmony with nature.\n\nThe residential community is near to the Dubai Creek tower that is a new global icon set to reshape the Dubai Skyline. The area including beautiful waterfront plaza surrounded by promenades, farmer\'s markets, and other events that foster a sense of community.\n\nConnectivity:‎\n• 15 minutes to DIFC\n• 15 minutes to World Trade Centre\n• 20 minutes to Burj Khalifa &amp; Downtown\n• 25 minutes to Dubai International Airport (DXB)\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-08 10:00:02',	'2023-06-08 10:00:02'),
