(241,	'App\\Models\\Property',	229,	'description',	'Unique Properties is thrilled to offer you this 2-bedroom apartment for rent in La Rive 3, Jumeirah.\n\nFeatures:‎\n• +190 berth marina and yacht club\n• Seaside and marina promenades\n• Private beach access\n• Fashionable boutiques, restaurants and cafés\n• World-class hotels and resorts in the vicinity\n• Outdoor parks and children’s play areas\n• Private landscaped terraces\n• Excellent private facilities and amenities\n\nUnit Details:\n• Bedroom:  2\n‎• ‎Bathrooms: 3\n• Parking Spaces: 1\n‎‎• ‎BUA: 1,340 sq.ft\n\nLa Rive Live for moments that you can\'t put into words!\nWith winding walkways, lush green terraces and views that dreams are made of, La Rive at Port de La Mer is truly one-of-a-kind. With a world-class marina and hospitality experiences, along with unmatched amenities, this island getaway is perfect for those who enjoy the finer things in life.\n\n\nConnectivity:‎\n‎•‎ ‎17 minutes’ drive to Dubai Mall\n•‎ ‎30 minutes to Palm Jumeirah\n‎•‎ ‎28 minutes to Burj Al Arab\n‎•‎ ‎33 minutes to The Walk JBR\n‎•‎ ‎‎20 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎53 minutes to Al Maktoum International Airport\n\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'202