(256,	'App\\Models\\Project',	2,	'long_description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">Bayview by Address Resorts is a project which will be nestled on Emaar Beachfront. The author of the development is Emaar Properties, who is a leading Emirati developer that has already delivered over 85K units, with over 27K currently under development. Address Hotels + Resorts is the first brand by Emaar Hospitality Group, providing guests and residents with excellent premium amenities and services. Bayview by Address Resorts is a perfect option for those wishing to experience private beach living on Emaar Beachfront.</div><div class=\"trix-content\"><br></div><div class=\"trix-content\">Among the units on offer in Bayview by Address Resorts will be branded furnished residences in 1–4 bedroom configurations with living areas ranging from 736 to 2,464 sqft, as well as spacious 4 and 6-bedroom penthouses with floor plan spaces ranging from 4,462 to 11,683 sqft, offering stunning 360-degree views of the Arabian Gulf, Palm Jumeirah and the surroundings. Sun shading elements, including balconies and perforated panels will be present in units, allowing natural light and ventilation into residences. Apartments will come fully furnished, allowing you to experience luxury living right after the completion of the project, which is planned to take place in Q3 2028.</div><div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\