(262,	'App\\Models\\PageContent',	1,	'description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;\n&#13;\n    <div class=\"trix-content\">&#13;\n&#13;\n    <div class=\"trix-content\">&#13;\n&#13;\n    <div class=\"trix-content\">&#13;\n&#13;\n    <p>Since our formation in 2008, Unique Properties has embarked on a transformative journey fueled by our unwavering commitment to customer-centricity and a passion for real estate. This distinctive approach set us apart from the competition and propelled us to become one of Dubai\'s leading agencies, setting new standards for quality and excellence.<br></p>&#13;\n&#13;\n</div>&#13;\n&#13;\n</div>&#13;\n&#13;\n</div>&#13;\n&#13;\n</div>&#13;\n</div>&#13;\n</div>',	'2023-06-16 09:00:03',	'2023-06-22 10:35:20'),
(263,	'App\\Models\\PageContent',	2,	'less_description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;\n    <p>Established in 2008, we have helped thousands of people from all over the world find their dream home and benefit from the best real estate investments available on the market to generate excellent rental yields and year-on-year capital appreciation.</p><p>We otter a wade range Of professional services to suit buyers, sellers, landlords and tenants alike Whether you\'re Looking to buy, sell or rent a property</p>&#13;&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-16 09:54:32',	'2023-06-22 11:08:18'),
(264,	'App\\Models\\PageContent',	2,	'more_description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;\n&#13;\n    <p>It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum</p>&#13;\n&#13;\n</div>&#13;\n</div>&#13;\n</div>',	'2023-06-16 09:54:32',	'2023-06-22 11:08:18'),
