(278,	'App\\Models\\PageContent',	12,	'description',	'<p>Since our formation in 2008, our core values have always remained at the heart of everything we do and these includes integrity, transparency and respect to name a few.</p><p>I formed Unique Properties with customer centricity and passion for real estate in mind and this was our differentiating factor from other companies. Over the years we have grown and developed our position in the market to set a new benchmark for quality and excellence.</p><p>Thanks to our inspiring business partners and a talented team of experienced and multi-lingual professionals, we have become one of Dubai\'s leading real estate agencies with numerous awards under our belt.</p><p>Over the years, we have helped thousands of clients to grow their wealth and real estate portfolio through tailor-made investment strategies focusing on the city\'s most lucrative developments in the best locations.</p>',	'2023-06-17 03:27:48',	'2023-06-17 03:27:48'),
