(292,	'App\\Models\\Project',	7,	'short_description',	'<p><span style=\"font-weight: 700;\">Short Description</span><br></p>',	'2023-06-19 06:22:22',	'2023-06-19 06:22:22'),
(293,	'App\\Models\\Project',	7,	'long_description',	'<p><span style=\"font-weight: 700;\">Long Description</span><br></p>',	'2023-06-19 06:22:22',	'2023-06-19 06:22:22'),
(294,	'App\\Models\\Project',	8,	'features_description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;\n    <ul><li>Como Residences will be nestled in the heart of Palm Jumeirah where iconic entertainment venues on the artificial island will be just minutes away from the stunning development. </li><li>Among them are Aquaventure Waterpark, with over 105 record-breaking slides, including Zoomerango, Leap of Faith and River Rapids, The Lost Chambers Aquarium, which is home to over 65K creatures living in 10 chambers, and Nakheel Mall with over 140 retail stores, 30 dining venues and The View At The Palm.<br></li></ul>&#13;&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-19 06:23:25',	'2023-06-26 08:50:58'),
(295,	'App\\Models\\Project',	8,	'short_description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;\n    <p>Como Residences is the water-inspired tower is nestled on Palm Jumeirah, <span style=\"font-size: 1rem;\">amongst extravagant resorts, lots of gourmet dining options and plenty of </span><span style=\"font-size: 1rem;\">high-end boutiques. The project offers apartments, duplexes and an exclusive </span><span style=\"font-size: 1rem;\">penthouse, offering 180 or 360-degree views of the Gulf and Dubai skyline</span></p>&#13;&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-19 06:23:25',	'2023-06-26 08:50:58'),
(296,	'App\\Models\\Project',	8,	'long_description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;\n    <p>Those wishing to experience ultra-luxury living in one of the most sought-after areas in Dubai might be interested in Como Residences, which will be nestled in the heart of Palm Jumeirah. Being inspired by the gentle waves of the sea and the sinuous curves left in the sand, Como Residences will become one of the most iconic towers on Palm Jumeirah. The stunning skyscraper is sculpted into a series of vertical lakes which include communal pools and premium private pools which come with sky terrace residences.</p><p>Living in Como Residences will allow you to benefit from access to exceptional amenities, including a private sandy beach pool on the podium level, landscaped recreational areas, a gymnasium, a spa and wellness centre, a private cafe, a business centre with meeting rooms, squash courts, paddle courts and much more. Full concierge services will be offered to future occupants of the tower, and each residence will come with 3–6 parking spaces, whilst owners of the exclusive penthouse will benefit from 10 parking spaces.</p>&#13;&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-19 06:23:25',	'2023-06-26 08:50:58'),
(297,	'App\\Models\\Developer',	5,	'long_description',	'<p>Dubai-based Nakheel is a world-leading master developer whose innovative, landmark projects form an iconic portfolio of master communities and residential, retail, hospitality and leisure developments that are pivotal to realising Dubai’s vision. Nakheel’s waterfront projects, including the world-famous, award-winning Palm Jumeirah, have added more than 300 kilometres to Dubai’s original, 70km coastline, paving the way for the development of hundreds of seafront homes, resorts, hotels and attractions.</p><p>Nakheel’s master developments span 15,000 hectares, accommodate nearly 300,000 people and provide a growing range of destinations, attractions and facilities for Dubai’s citizens, residents and tourists. They include Palm Jumeirah, The World, Jumeirah Islands, Jumeirah Park, Jumeirah Village, Al Furjan, The Gardens, Discovery Gardens, Jebel Ali Village, Dragon City, Nad Al Sheba Villas, Warsan Village, International City and the upcoming Dubai Islands – a new destination for tourism, living and leisure at Dubai’s oldest, most traditional trading hub.</p>',	'2023-06-19 06:56:26',	'2023-06-19 06:56:26'),
(298,	'App\\Models\\Developer',	5,	'short_description',	'<p>Nakheel develops thriving residential communities with excellent community amenities including leisure and hospitality destinations as well as some of Dubai’s most popular shopping malls, souks and community retail centres.<br></p>',	'2023-06-19 06:56:26',	'2023-06-19 06:56:26'),
(299,	'App\\Models\\Agent',	46,	'message',	'<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.<br></p>',	'2023-06-19 07:15:10',	'2023-06-19 07:15:10'),
(300,	'App\\Models\\Community',	21,	'description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">Dubai Marina, with its famous Dubai Marina Mall will be accessible within 10 minutes by car. Financial districts within the emirate, including Business Bay and Downtown Dubai, will be within a 20-minute drive from the development, and travel time to Dubai International Airport will take 25 minutes by car.</div><div class=\"trix-content\"><br></div><div class=\"trix-content\">The exclusive project of Como Residences is planned to be handed over in Q3 2027. You will always feel comfortable and secure in Como Residences due to its concierge services, a private lift lobby to each apartment, independent storage compartments in each unit and exclusive amenities that are ideal for business professionals, freelancers and families with children.</div><div class=\"trix-content\">&#13;&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-19 07:21:29',	'2023-06-20 06:00:45'),
(301,	'App\\Models\\Community',	21,	'short_description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    Palm Jumeirah where iconic entertainment venues on the artificial island will be just minutes away from the stunning development. Among them are Aquaventure Waterpark, with over 105 record-breaking slides, including Zoomerango, Leap of Faith and River Rapids, The Lost Chambers Aquarium, which is home to over 65K creatures living in 10 chambers, and Nakheel Mall with over 140 retail stores, 30 dining venues and The View At The Palm.<div class=\"trix-content\">&#13;&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-19 07:21:29',	'2023-06-20 06:00:45'),
