(316,	'App\\Models\\Property',	231,	'description',	'Unique Properties exclusively presents this 3 Bedroom + Maids Triplex unit in Panorama at The Views Tower 3.\n\nFeatures:‎\n• New to market\n• 2 covered parking\n• Closed sun room\n• Immaculate condition\n• Maids room with bathroom\n• Full Golf Course / Marina Skyline View\n• Open plan kitchen\n• Gated community\n• Dedicated maintenance team\n• 24-hour security guards\n• Large community halls\n• State-of-the-art amenities\n\nUnit Details:\n• Bedroom:  3 + Maids\n• Duplex with Rooftop\n‎• ‎Bathrooms: 4\n‎‎• ‎BUA: 2,813 sq.ft\n\nThe Views is a highly sought after tightly held community and is the perfect lifestyle choice for professionals. Offering breath taking lakeside or golf club views of the Emirates Golf Club. Situated just off of Sheikh Zayed Road and in close proximity to the beautiful JBR beach and amazing Dubai Marina, residents will also enjoy the landscaped greenery, swimming pools, mini sports courts, shopping areas and picturesque parks this vibrant hub has to offer.\n\nConnectivity:‎\n‎•‎ ‎18 minutes’ drive to Dubai Mall\n•‎ ‎13 minutes to Palm Jumeirah\n‎•‎ ‎15 minutes to Burj Al Arab\n‎•‎ ‎17 minutes to The Walk JBR\n‎•‎ ‎‎26 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎33 minutes to Al Maktoum International Airport\n\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-19 15:42:23',	'2023-06-23 13:54:20'),
(317,	'App\\Models\\Property',	232,	'description',	'Unique Properties is thrilled to bring you this luxury 1-bedroom apartment situated in St. Regis Residences Tower 1, Downtown Dubai.‎\n\nFeatures:‎\n‎•‎ ‎Open views of Burj Khalifa, Dubai Opera and Dubai Fountains\n‎‎• ‎Feature high-end hotel services and amenities\n‎• ‎Interesting Payment Plan\n‎• ‎Close to shopping malls\n‎• ‎Transport accessibility\n‎• ‎CCTV\n‎• ‎Adult and children’s swimming pool\n\n\nUnit Details:‎\n‎• ‎BUA: 692 sqft\n‎• Bedroom: 31\n‎• ‎Bathrooms: 1‎\n‎• Parking spaces: 1‎\n\n\nAbout the Community:‎\nDesigned to the exacting standards of the brand, The St. Regis Residences, it offers a selection of cutting-edge homes ‎and redefines luxury.‎\nThe Opera District is one of the most prestigious districts in Dubai and offers several luxury hotels, waterfront promenades, and ‎elite residential complexes, and it is located near Sheikh Zayed Road, which provides residents with easy access to other parts of the ‎emirate.‎\n\n\nConnectivity:‎\n‎• 5 minutes to drive to Dubai Mall\n‎• 20 minutes to Palm Jumeirah\n‎• 21 minutes to Burj Al Arab\n‎• 25 minutes to The Walk JBR\n‎• 15 minutes to Dubai International Airport (DXB)‎\n‎• 40 minutes Maktoum International Airport‎\n\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.‎\n\n\n‎ Why Unique Properties?‎\n‎• RERA Top Performing Award 2021‎\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022‎\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021‎\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021‎\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022‎\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n‎• NAKHEEL Top Broker for 2021‎ &amp; 2022‎\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021‎\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017‎\n‎• MEYDAN Top Performing Award 2021‎\n‎• MAJID AL FUTTAIM Top Performer 2020‎\n‎• ALDAR Top Performer 2021‎',	'2023-06-19 15:42:25',	'2023-06-19 15:42:25'),
(318,	'App\\Models\\Property',	233,	'description',	'Unique Properties is thrilled to offer you this luxurious 3-bedroom apartment in Avani Palm View Hotel &amp; Suites, situated in the heart of Dubai Media City TECOM.\n\nFeatures:‎\n• Fully furnished service apartment\n• Sea, Palm Jumeirah, Burj Al Arab and Ain Dubai views\n• Luxury Living\n• Amazing interiors\n• Open-plan kitchen\n • Balcony\n• Close to the beach\n• Swimming pool has a Burj Al Arab View\n\nUnit Details:\n• Bedroom:  3 \n‎• ‎Bathrooms: 4\n• Parking: 2\n• BUA: 2,260 sq.ft\n\nAvani Hotels and Resorts is managing the luxurious Avani Palm Views hotel in Dubai Media City, featuring exquisite furniture and an ocean-inspired colour scheme. Amenities include free WiFi, free valet parking, a pool bar, an all-day dining restaurant, a café, and a state-of-the-art gymnasium and swimming pool.\n\nConnectivity:\n‎•‎ ‎15 minutes’ drive to Dubai Mall\n•‎ ‎7 minutes to Palm Jumeirah\n‎•‎ ‎13 minutes to Burj Al Arab\n‎•‎ ‎11 minutes to The Walk JBR\n‎•‎ ‎‎24 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎32 minutes to Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-19 15:42:25',	'2023-06-19 15:42:25'),
(319,	'App\\Models\\Property',	234,	'description',	'Unique Properties is pleased to offer you this luxurious 1-bedroom apartment in a branded tower designed by Swiss Jeweler De Grisogono called Safa Two in Aykon City 3.\n\nFeatures:‎\n‎•‎ Sea View\n‎• Two luxurious skyscrapers\n‎• Abundant greeneries\n‎• Architectural marvel\n‎• All luxurious units\n‎• World class amenities\n‎• High end restaurants\n‎• Fitted kitchen\n\nUnit Details:‎\n‎• ‎BUA: 776 sqft\n‎• Bedroom: 1‎\n‎• ‎Bathrooms: 1\n‎• Parking spaces: 1‎\n\nSafa Two is an amalgamation of man-made luxury &amp; green surroundings, Damac Safa Two apartments are meticulously planned for those with an understanding of the better things in day-to-day life.\n\nConnectivity:‎\n‎• 7 minutes to drive to Dubai Mall\n‎• 15 minutes to Palm Jumeirah\n‎• 14 minutes to Burj Al Arab\n‎• 20 minutes to The Walk JBR\n‎• 15 minutes to Dubai International Airport (DXB)‎\n‎• 40 minutes Maktoum International Airport‎\n\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.‎\n\n\n‎ Why Unique Properties?‎\n‎• RERA Top Performing Award 2021‎\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022‎\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021‎\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021‎\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022‎\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n‎• NAKHEEL Top Broker for 2021‎ &amp; 2022‎\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021‎\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017‎\n‎• MEYDAN Top Performing Award 2021‎\n‎• MAJID AL FUTTAIM Top Performer 2020‎\n‎• ALDAR Top Performer 2021‎',	'2023-06-19 15:42:25',	'2023-06-19 15:42:25'),
(320,	'App\\Models\\Property',	235,	'description',	'Unique Properties are pleased to offer you this Brand New 5 Bedroom + Maids room Villa that features a modern design and resort-style living. \n\nFeatures:\n• Private Garden &amp; Pool\n• Trump Lifestyle Card - which grants privileged access to all Trump Hotels globally\n• Panoramic windows that look out over Trump International Golf Club Dubai\n• Complete luxury furniture set\n• Floor to Ceiling windows\n• Built-in Wardrobes\n• Fully Fitted Kitchen\n• Gated Community\n• Green Community\n\nUnit Details:\n• Bedroom:  5 + Maids room\n‎• ‎Bathrooms: 6\n• Parking Spaces: 3\n‎‎• ‎BUA: 4919 sq.ft\n\nDAMAC Hills is an established self-contained community in the popular Dubailand, comprising villas, apartments and a hotel. Homes are set around the Trump International Golf Club Dubai or The Park, nearly four million square feet of themed gardens, sporting amenities, a skate park, and stables. There is also a school, Carrefour supermarket and ‘Green Zone’, with more planned.\n\nConnectivity:\n• 20 minutes to Dubai Mall\n• 21 minutes to Palm Jumeirah\n• 20 minutes to Burj Al Arab\n• 30 minutes to Dubai Marina\n• 32 minutes to Dubai International Airport (DXB)\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR