(321,	'App\\Models\\Property',	236,	'description',	'Unique Properties is pleased to offer you this exclusive 2-bedroom + maids apartment that features a modern design, world-class amenities, and resort-style living.\n\nFeatures:\n• Premium lifestyle for the whole family\n• Facing pool and park view\n• Floor to Ceiling windows\n• Built-in Wardrobes\n• Fully Fitted Kitchen\n• Children’s play areas\n\nUnit Details:\n• BUA: 1359.4 sq.ft.\n• Bedrooms: 2 + Maids Room\n• Bathrooms: 3\n• Parking spaces: 1\n• Ready in 6 months \n\nMadinat Jumeirah Living is a high-end residential development in Umm Suqeim offering beautiful views of the magnificent Burj Al Arab and the breathtaking waterfront. Enjoying a central location in Jumeirah, it is near five-star hotels, stylish retail outlets, the charming Madinat Jumeirah, and the sought-after Wild Wadi Water Park.\n\nConnectivity:‎\n‎•‎ ‎15 minutes’ drive to Dubai Mall\n•‎ ‎12 minutes to Palm Jumeirah\n‎•‎ ‎8 minutes to Burj Al Arab\n‎•‎ ‎16 minutes to The Walk JBR\n‎•‎ ‎‎23 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎38 minutes to Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-19 15:42:25',	'2023-06-19 15:42:25'),
