erformer 2020\n• ALDAR Top Performer 2021',	'2023-06-19 15:42:30',	'2023-06-19 15:42:30'),
(343,	'App\\Models\\Property',	258,	'description',	'Unique Properties is pleased to offer this exclusive 2-bedroom apartment in The Address ‎Jumeirah Resort and Spa, JBR.\n\nFeatures:\n‎• Full sea view\n‎• Luxury waterfront living\n‎• Vast living area\n• Floor to ceiling windows\n‎• Open kitchen and built-in appliances\n‎• ‎Large balcony with amazing view\n‎• En-suite bedrooms\n‎• Built-in wardrobes\n\nUnit Details:\n‎• Above 55th floor\n‎• ‎Type R2C\n‎‎• ‎BUA: 1157 sqft\n‎• Bedroom: 2‎\n‎• Bathrooms: 3‎\n‎• Parking: 1‎\n‎• Vacant on Transfer\n\nThe Address Residences Jumeirah Resort and Spa is a new beachfront development that integrates a hotel branded by premium luxury five-star Address Hotels + Resorts. It is ideal for high-end professionals and family to enjoy the luxury of beach living and access to a host of premium amenities, including a state-of-the-art fitness centre, exquisite swimming pools, and a variety of dining options.\n\nConnectivity:‎\n‎•‎ ‎20 minutes’ drive to Dubai Mall\n•‎ ‎12 minutes to Palm Jumeirah\n‎•‎ ‎17 minutes to Burj Al Arab\n‎•‎ ‎9 minutes to The Walk JBR\n‎•‎ ‎‎28 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎32 minutes to Al Maktoum International Airport\n\nAgents are welcome if there\'s a serious client.\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\nWhy Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n•