(345,	'App\\Models\\Property',	260,	'description',	'Unique Properties proudly presents this fully furnished 2-bedroom Apartment in La Côte 4, La Mer, with BILLS INCLUSIVE!\n\nFeatures:‎\n• High-quality finishing and fixtures\n• High-end security system\n• Large Balcony / Terrace\n• Exquisite bathroom suites\n• Health Club \n• Gated Community and Private Beach\n• Restaurants and coffee-shops\n• Pet Friendly Building\n\nUnit Details:\n• Bedroom:  2\n‎• ‎Bathrooms: 2\n• Parking Spaces: 1\n‎‎• ‎BUA: 1223 sq.ft\n\nPort de La Mer offers a peaceful Mediterranean style living, the community is directly on the promenade where many restaurants, cafes and boutique shops are located. The community offers a unique, seaside lifestyle whilst still being 15 minutes away from Downtown Dubai and links to the rest of the city, where you have many malls, schools and other amenities.\n\nConnectivity:‎\n‎•‎ ‎18 minutes’ drive to Dubai Mall\n•‎ ‎30 minutes to Palm Jumeirah\n‎•‎ ‎28 minutes to Burj Al Arab\n‎•‎ ‎34 minutes to The Walk JBR\n‎•‎ ‎‎21 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎53 minutes to Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-19 15:42:30',	'2023-06-19 15:42:30'),
(346,	'App\\Models\\Property',	261,	'description',	'Unique Properties proudly presents this stunning 1-bedroom apartment for rent in The Address Residences, Dubai Opera.\n\nProperty Features:\n• Fully furnished with high-end furniture\n• 5-star hotel services\n• Balcony with boulevard view.\n• Fully equipped kitchen, modern and high specs\n• Immaculate wooden finishes\n• State of the art amenities\n• Infinity pool with full Burj Khalifa view\n\nUnit Details:\n• Bedroom: 1\n‎• ‎Bathrooms: 1 \n• Parking space: 1\n• BUA: 799 sq.ft\n\nThe Opera Grand tower in Downtown Dubai is ideal for families who value privacy as there are only three to five units per floor with large balconies and the units are also elegantly designed with modern fittings and fixtures.  Residents also enjoy the benefits of living in close proximity to The Dubai Mall and many other nearby facilities. \n\nConnectivity:\n• 4 minutes to drive to Dubai Mall\n• 20 minutes to Palm Jumeirah\n• 19 minutes to Burj Al Arab\n• 24 minutes to the Walk\n• 16 minutes to Dubai International Airport \n• 46 minutes to Al Maktoum Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-19 15:42:30',	'2023-06-19 15:42:30'),
