(354,	'App\\Models\\Project',	9,	'features_description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;\n    <p>Fashion branded BUiding elevation</p><p>Exqusite lobby </p><p>Impressive location</p><p>Excellent views from the balcony</p>&#13;&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-20 07:43:22',	'2023-06-26 10:42:01'),
(355,	'App\\Models\\Project',	9,	'short_description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;\n    <p>Danube Fashionz is a unique complex offering Dubai’s first FashionTV branded <span style=\"font-size: 1rem;\">residences. The haute couture development will be located in the developed </span><span style=\"font-size: 1rem;\">area of JVT. Those interested in experiencing luxury living with access to an </span><span style=\"font-size: 1rem;\">ideal blend of amenities, can choose from branded studios and apartments.</span></p>&#13;&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-20 07:43:22',	'2023-06-26 10:42:01'),
(356,	'App\\Models\\Project',	9,	'long_description',	'<div class=\"trix-content\">&#13;\n    <div class=\"trix-content\">&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;\n    <div class=\"trix-content\">&#13;&#13;&#13;&#13;&#13;\n    <p><span style=\'color: rgb(51, 51, 51); font-family: \"Open Sans Light\"; font-size: 17px;\'>Fashionz by Danube is one of the most ambitious projects in Jumeirah Village Triangle. The skyscraper will consist of a ground floor, 5 podium levels, 56 floors and a rooftop. Those interested in purchasing a branded residence can choose from studios and 1–3 bedroom apartments branded by FashionTV.</span><br style=\'color: rgb(51, 51, 51); font-family: \"Open Sans Light\"; font-size: 17px;\'><br style=\'color: rgb(51, 51, 51); font-family: \"Open Sans Light\"; font-size: 17px;\'><span style=\'color: rgb(51, 51, 51); font-family: \"Open Sans Light\"; font-size: 17px;\'>The FashionTV branded amenities will include a perfect range of outdoor, indoor and shaded amenities, allowing future residents to experience only the best premium living. FashionTV branded FTV Salon Aesthetic Center will enable you to achieve fashion-forward style. Luxury dining will also be available in a lavish FashionTV rooftop restaurant with stunning views and gourmet cuisine. A spa and therapy rooms, a beauty salon, a trampoline park, a skating rink, as well as a rooftop outdoor area with a padel court, a rooftop infinity pool, a pool deck, a BBQ area, an outdoor chess cinema and a snooker zone, will allow you to relax and entertain yourself right on the territory of the development.</span><br></p>&#13;&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;&#13;\n</div>&#13;&#13;&#13;\n</div>&#13;&#13;\n</div>&#13;\n</div>',	'2023-06-20 07:43:22',	'2023-06-26 10:42:01'),
