(393,	'App\\Models\\Property',	266,	'description',	'Unique Properties is thrilled to offer you this Arabic style 1-bedroom apartment for sale in Tajer Residences, Old Town.\n\nFeatures:‎\n• Spacious and bright\n• En-suite bedroom\n• Spacious bedrooms\n• Fully equipped kitchen\n• Modern natural materials design\n• Wide balcony\n• Entertainment areas\n• State-of-the art amenities\n\nUnit Details:\n• Bedroom: 1\n‎• ‎Bathrooms: 2\n‎‎• ‎BUA: 958 sq.ft\n• Parking: 1\n• Vacant on Transfer\n\nThe Al Tajer Residences is a complex of Arabic style low rise buildings located in The Old Town, Downtown Dubai that offers lavish apartments with marble flooring and sarjool plastering to reflect the early twentieth century of traditional buildings. Including, the Al-Bastakia neighbourhood of Bur Dubai and the residences of Sheik Saeed Al-Maktoum and Mohammed Shareef Boukas\n\nConnectivity:‎\n‎•‎ ‎9 minutes’ drive to Dubai Mall\n•‎ ‎24 minutes to Palm Jumeirah\n‎•‎ ‎23 minutes to Burj Al Arab\n‎•‎ ‎28 minutes to The Walk JBR\n‎•‎ ‎‎21 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎49 minutes to Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-23 13:54:15',	'2023-06-26 08:59:11'),
