(414,	'App\\Models\\Property',	287,	'description',	'Unique Properties proudly presents this 2-bedroom in Creek Beach – Sunset, Dubai Creek Harbour\n\nProperty Features:‎\n‎• Floor to ceiling windows\n‎• Community view\n‎• Built-in wardrobes\n‎• Fully fitted kitchen\n‎• Private gardens\n‎• Outdoor BBQ areas\n‎• Premium amenities\n\nUnit Details:\n‎• BUA: 1,136 sq.ft\n‎• Bedroom:‎ 2\n‎• Bathrooms:‎ 2\n‎• Parking: 1‎\n\nSunset at Creek Beach is a low-rise building which consists of a 300m long private beach, equipped with several dining options and a special ‎events area for residents to host parties and family gatherings. This is the first of its kind in Dubai. This iconic waterfront development will let ‎visitors and residents experience the Miami Beach lifestyle right at the heart of Dubai Creek Harbour.‎\n\nLocation:‎\n‎• 14 minutes to Dubai Mall\n‎• 25 minutes to Palm Jumeirah\n‎• 20 minutes to Burj Al Arab\n‎• 15 minutes to Dubai International Airport (DXB)‎\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-26 08:59:05',	'2023-06-26 08:59:05'),
(415,	'App\\Models\\Property',	288,	'description',	'Unique Properties proudly presents this spacious and unique layout 2 bedrooms apartment in the prestigious and award-winning Cayan Tower in Dubai Marina!\n\nFeatures:\n• Vacant on transfer\n• High floor\n• Partly upgraded\n• Full Marina view\n• Spacious living &amp; dining areas\n• Semi closed kitchen\n• Floor to ceiling windows\n\nUnit Details:\n• Bedroom: 2\n‎• ‎Bathrooms:3\n• Parking space: 1\n• BUA: 1,521 sq.ft\n\nCayan Tower, also known as Infinity Tower, is a development by Cayan Property Development. It is a high-rise and one of the most unique buildings in the world with a twist of 90 degrees. Its location lets the residents easily access nearby supermarkets and retail shops. It has comforting amenities and services which provide an ideal lifestyle.\n\nConnectivity:\n• 21 minutes to drive to Dubai Mall\n• 12 minutes to Palm Jumeirah\n• 18 minutes to Burj Al Arab\n• 10 minutes to the Walk\n• 30 minutes to Dubai International Airport\n• 36 minutes to Al Maktoum Airport\n\nPlease contact us today to find out more and arrange a viewing.\nHot Line Mobile No: +971524193888\n\nAbout Unique Properties:\n• EMAAR\'s Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020 and 2021\n• DUBAI PROPERTIES\' Top Broker of 2015, 2016, 2017, 2018, 2019, 2020 and 2021\n• DUBAI PROPERTIES\' No.1 Top Selling Agent in 2017, 2018 and 2020\n• MERAAS Top Agent of 2018, 2019, 2020 and 2021\n• NSHAMA\'s Top Agent of 2015, 2016 and 2020\n• NAKHEEL’s Top Broker for 2021\n• DAMAC\'s no. 1 Real Estate Agency in 2020\n• DUBAI SOUTH Top Performing Agent 2016\n• DANUBE PROPERTIES Premier Broker of 2015 and 2016\n• PROPERTY FINDER’s outstanding online listings award winner 2014',	'2023-06-26 08:59:11',	'2023-06-26 08:59:11'),
(416,	'App\\Models\\Property',	289,	'description',	'Unique Properties proudly presents this stunning 4-bedroom townhouse for rent in Amaranta – Villanova, Dubai Land.\n\nFeatures:\n• Gated community\n• Open plan kitchen\n• Exciting sporting entertainment\n• Wellness clinics\n• Shaded children\'s area\n• Retail outlets with outdoor seating\n• Recreational areas &amp; swimming pool\n\nUnit Details:\n• Bedroom: 4 \n‎• ‎Bathrooms:  4\n‎‎• ‎BUA: 2,236 sq.ft\n• Parking spaces: 3\n• Vacant on August 01, 2023\n\nAmaranta is a collection of well-designed townhouses equipped with modern amenities and facilities. The community offers an active lifestyle with wide-open spaces, walking trails, a sports court, and a gym. The well-connected road network is another feature of the community.\n\nConnectivity:\n• 29 minutes to drive to Dubai Mall\n• 30 minutes to Palm Jumeirah \n• 29 minutes to Burj Al Arab \n• 34 minutes to The Walk JBR\n• 29 minutes to Dubai International Airport (DXB)\n• 31 minutes the new Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-26 08:59:11',	'2023-06-26 11:25:22'),
(417,	'App\\Models\\Service',	5,	'description',	'<p>When you list your property with us, we will take care of professional photography and videography to ensure your asset is represented in the most favorable light and is well-presented for marketing purposes.<br></p>',	'2023-06-26 10:28:40',	'2023-06-26 10:28:40'),
(418,	'App\\Models\\Service',	6,	'description',	'<p>We will arrange and manage all your property viewings with potential tenants and handle in-person screenings and reference checks to ensure the optimum level of due diligence.<br></p>',	'2023-06-26 10:29:30',	'2023-06-26 10:29:30'),
(419,	'App\\Models\\Service',	7,	'description',	'<p>We will prepare and formalize all the necessary documents needed for new tenant leases and can manage all renewals on your behalf. Our expert agents will ensure to protect both the interests of our landlords and tenants by registering the tenancy contract with Ejari, which ensures the contract is legally binding between all parties.<br></p>',	'2023-06-26 10:30:17',	'2023-06-26 10:30:17'),
(420,	'App\\Models\\Service',	8,	'description',	'<p>We can manage rent cheques collections and ensure these are deposited in the landlord’s accounts. In the unlikely event that a cheque bounces or a tenant default on a payment, our team will recover the dues by mediating with the tenant or a legal case will be filed at the rental dispute committee in line with Dubai rental laws<br></p>',	'2023-06-26 10:31:10',	'2023-06-26 10:31:10'),
(421,	'App\\Models\\Service',	9,	'description',	'<p>We will ensure a comprehensive property inspection, with photographic evidence of the current condition &amp; prepare a comprehensive report for the property every time a tenant moves in &amp; out.<br></p>',	'2023-06-26 10:31:55',	'2023-06-26 10:31:55'),
(422,	'App\\Models\\Service',	10,	'description',	'<p>We will ensure to communicate via official correspondence in advance of lease renewal notice periods to provide a professional and transparent service to both landlords and tenants. Our expert team will also advise their clients in advance regarding rental increases in the market, in line with Dubai’s Real Estate Regulatory Authority rental index.<br></p>',	'2023-06-26 10:32:50',	'2023-06-26 10:32:50'),
(423,	'App\\Models\\Service',	11,	'description',	'<p>Upon our client’s request, we will provide cash-flow statements detailing income and itemised expenses to ensure transparency and complete satisfaction.<br></p>',	'2023-06-26 10:33:42',	'2023-06-26 10:33:42'),
(424,	'App\\Models\\Service',	12,	'description',	'<p>We offer comprehensive property inspections and provide you with a detailed report with supporting photography which can be presented to the developer. We have a dedicated and trusted team of tradesmen and contractors to take care of repairs and maintenance work on your property. No job is too big or small. At Unique we can manage ongoing tenant maintenance issues and advise if the work required falls under the tenant or landlord’s responsibility.<br></p>',	'2023-06-26 10:34:33',	'2023-06-26 10:34:33');
