(425,	'App\\Models\\Service',	13,	'description',	'<p>Additional services include DEWA &amp; chiller connection and payment of DEWA &amp; chiller bills and service charges.<br></p>',	'2023-06-26 10:35:15',	'2023-06-26 10:35:15'),
(426,	'App\\Models\\Property',	290,	'description',	'Unique Properties is thrilled to offer you this 2-bedroom apartment for rent in Golf Suites, Dubai Hills Estate.\n\nFeatures:‎\n• High Floor\n• Modern Finish\n• Brand new\n• Large Lay out\n• Open plan kitchen\n• Covered parking\n\nUnit Details:\n• Bedroom: 2\n‎• ‎Bathrooms: 3\n‎‎• ‎BUA: 1,118 sq.ft\n• Parking: 1\n\nGolf Suites is ideally situated between Dubai Marina and Downtown Dubai. With one-, two- and three-bedroom apartments with balconies, residents can relax at the comfort of their homes and indulge scenic views of the meadows and palm trees, or take a dip in the infinity pool.\n\nWithin the community, residents can enjoy unwind and enjoy 18-hole Championship golf course, Clubhouse, on-site gym, mall, park as well as explore activities that nourish the mind, body and soul.\n\nConnectivity:‎\n‎•‎ ‎16 minutes’ drive to Dubai Mall\n•‎ ‎18 minutes to Palm Jumeirah\n‎•‎ ‎16 minutes to Burj Al Arab\n‎•‎ ‎22 minutes to The Walk JBR\n‎•‎ ‎‎21 minutes to Dubai International Airport (DXB)‎\n‎•‎ ‎37 minutes to Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\n Why Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-27 08:13:05',	'2023-06-27 08:13:05'),
(427,	'App\\Models\\Property',	291,	'description',	'Unique Properties is pleased to offer you this luxurious 2-bedroom apartment in The Address Jumeirah Resort And Spa.\n\nFeatures:\n•‎ 5 Star Address Hotels &amp; Resorts\n•‎ Fully Serviced\n•‎ Fully Furnished\n•‎ Full Sea View\n‎•‎ Floor to Ceiling windows\n‎•‎ Built-in Wardrobes\n‎•‎ Fitted Kitchen\n‎•‎ Above 35th Floor\n‎•‎ Available for monthly rental of AED 22K\n\nAgents are welcome if there’s a serious client!\n\nUnit Details:\n•‎ BUA: 1,477 sq.ft\n•‎ Bedroom: 2‎\n‎•‎ Bathrooms: 3‎\n‎•‎ Parking: 1‎\n‎•‎ Type S2E\n\nThe Address Residences Jumeirah Resort and Spa is a new beachfront development that integrates a hotel branded by premium luxury five-star Address Hotels + Resorts. It is ideal of high-end professionals and family to enjoy the luxury of beach living and access to a host of premium amenities, including a state-of-the-art fitness centre, exquisite swimming pools, and a variety of dining options.\n\nConnectivity:\n•‎‎ 20 minutes’ drive to Dubai Mall\n•‎ 12 minutes to Palm Jumeirah\n‎•‎ 17 minutes to Burj Al Arab\n‎•‎‎ 9 minutes to The Walk JBR\n‎•‎‎‎ 28 minutes to Dubai International Airport (DXB)‎\n‎•‎‎ 32 minutes to Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\nWhy Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer 2020\n• ALDAR Top Performer 2021',	'2023-06-27 08:13:05',	'2023-06-27 08:13:05'),
(428,	'App\\Models\\Property',	292,	'description',	'Unique Properties is pleased to offer you this luxurious 2-bedroom apartment in The Address Jumeirah Resort And Spa.\n\nFeatures:\n•‎ 5 Star Address Hotels &amp; Resorts\n•‎ Fully Serviced\n•‎ Fully Furnished\n•‎ Full Sea View\n‎•‎ Floor to Ceiling windows\n‎•‎ Built-in Wardrobes\n‎•‎ Fitted Kitchen\n‎•‎ Above 35th Floor\n‎•‎ Available for monthly rental of AED 22K\n\nAgents are welcome if there’s a serious client!\n\nUnit Details:\n•‎ BUA: 1,477 sq.ft\n•‎ Bedroom: 2‎\n‎•‎ Bathrooms: 3‎\n‎•‎ Parking: 1‎\n‎•‎ Type S2E\n\nThe Address Residences Jumeirah Resort and Spa is a new beachfront development that integrates a hotel branded by premium luxury five-star Address Hotels + Resorts. It is ideal of high-end professionals and family to enjoy the luxury of beach living and access to a host of premium amenities, including a state-of-the-art fitness centre, exquisite swimming pools, and a variety of dining options.\n\nConnectivity:\n•‎‎ 20 minutes’ drive to Dubai Mall\n•‎ 12 minutes to Palm Jumeirah\n‎•‎ 17 minutes to Burj Al Arab\n‎•‎‎ 9 minutes to The Walk JBR\n‎•‎‎‎ 28 minutes to Dubai International Airport (DXB)‎\n‎•‎‎ 32 minutes to Al Maktoum International Airport\n\nHurry! Properties like this don’t come onto the market every day. Call +971524193888‎ to find out more.\n\nWhy Unique Properties?\n• RERA Top Performing Award 2021\n‎• EMAAR Platinum Agent in 2012, 2013, 2014, 2015, 2016, 2017, 2018, 2019, 2020, 2021‎, &amp; 2022\n‎• DUBAI PROPERTIES Top Broker 2015, 2016, 2017, 2018, 2019, 2020, &amp; 2021\n‎• DUBAI HOLDING No.1 Top Broker 2018, &amp; 2021\n‎• DAMAC No.1 Real Estate Agency in 2020, 2021, &amp; 2022\n‎• NSHAMA Top Agent of 2015, 2016, 2017, &amp; 2020‎\n‎• DANUBE Premier Broker of 2015 &amp; 2016‎\n• NAKHEEL Top Broker for 2021‎ &amp; 2022\n‎• MERAAS Top Agent of 2018, 2019, 2020, &amp; 2021\n‎• DUBAI SOUTH Top Broker 2016‎ &amp; 2017\n• MEYDAN Top Performing Award 2021\n• MAJID AL FUTTAIM Top Performer