INSERT INTO `testimonials` (`id`, `client_name`, `feedback_title`, `feedback`, `status`, `rating`, `agent_id`, `user_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1,	'Mubariz Murtaza',	'Hats off to Unique for the professionalism',	'Hats off to Unique for the professionalism and extreme caution with which they handled my case. Special thanks to Ali Reza for managing everything splendidly and making sure all my needs were met. He did not disappoint, and he did not leave me dissatisfied. I’d recommend him to everyone looking to invest in the Dubai real estate market with little to no knowledge about it. Here’s his number for the ones interested: +971509578272 :)',	'active',	'5',	5,	1,	NULL,	'2023-06-05 02:49:45',	'2023-06-17 03:21:07'),
(2,	'Prakul Rathnakar',	'Hassle-free experience in finding me the right place',	'I would like to thank Vanessa Lenger from Unique Properties for helping me with a hassle-free experience in finding me the right place. Vanessa was extremely professional, always showed up on time and assisted me in finding a place that I like, and also was kind enough to help me till the move-in procedure. I would highly recommend Vanessa for a stress-free professional experience to anyone who\'s looking for a property in Dubai! She\'s one of the best agents I\'ve met.\r\nThank you, Vanessa.',	'active',	'5',	1,	1,	NULL,	'2023-06-17 03:19:46',	'2023-06-17 03:19:54'),
(3,	'Jacob Sundberg',	'Excellent advice which was an eye-opener',	'I’ve been well taken care of, at every step of the process. I can proudly recommend both Ali who understood me on a personal level and knew exactly what would be best for me. Also, Linn ambitiously gave me excellent advice which was an eye-opener and led to me doing a much better investment.',	'active',	'5',	5,	1,	NULL,	'2023-06-17 03:22:29',	'2023-06-17 03:22:29'),
(4,	'Van Pascaul',	'Simplified all procedure till handover',	'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.',	'active',	'4',	4,	1,	NULL,	'2023-06-17 03:24:54',	'2023-06-17 03:24:54'),
(5,	'Testing',	'Testting',	'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s',	'active',	'1',	5,	1,	NULL,	'2023-06-18 06:35:19',	'2023-06-18 06:35:19'),
(6,	'aRSALAN',	'Client Feedback',	'Bohot acha kaam kartay hain. Property lelo insa',	'active',	'5',	2,	1,	'2023-06-19 13:44:14',	'2023-06-19 13:12:29',	'2023-06-19 13:44:14'),
(7,	'John',	'Best Customer Servicesdfsdf',	'I had a best experience of my lse with Unqiue Properties! Their service has been incredible. Hatts off to Paul Marker for his exception proffessionalism.',	'active',	'5',	46,	1,	NULL,	'2023-06-20 08:08:42',	'2023-06-22 09:02:34');
